// This extension needs to be unsandboxed to run!
(async function(Scratch) {
    "use strict";

    const blocks = [];
    let domains = [];
    let dpi = [];

    function httpGet(theUrl, returnResponse) {
        let xmlHttp = new XMLHttpRequest();
        xmlHttp.open("GET", theUrl, false);
        xmlHttp.send(null);
        if (returnResponse == true) {
            return xmlHttp
        } else {
            return xmlHttp.responseText
        }
    }

    class Extension {
        getInfo() {
            domains = JSON.parse(httpGet("https://api.codetabs.com/v1/proxy/?quest=https://reestr.rublacklist.net/api/v3/domains/"));
            let soon_dpi = JSON.parse(httpGet("https://api.codetabs.com/v1/proxy/?quest=https://reestr.rublacklist.net/api/v3/dpi/"))
            for (let i in soon_dpi) {
                let domain = soon_dpi[i].domains
                for (let num in domain) {
                    dpi.splice(0, 0, domain[num]);
                }
            }
            return {
                "blockIconURI": "data:image/png;base64,",
                "menuIconURI": "data:image/png;base64,",
                "id": "Roskomnadzor",
                "name": Scratch.translate("Roskomnadzor"),
                "color1": "#1560bd",
                "tbShow": true,
                "blocks": blocks,
                "menus": {}
            }
        }
    }
    function createBlock(type, id, text, argsument, func) {
        blocks.push({
            opcode: id,
            blockType: type,
            text: text,
            arguments: argsument,
            disableMonitor: true,
            isEdgeActivated: false
        });
        Extension.prototype[id] = func;
    }
    createBlock(Scratch.BlockType.BOOLEAN, "checkDomain", Scratch.translate("check domain [DOMAIN] for block"), {
        DOMAIN: {
            type: Scratch.ArgumentType.STRING,
            defaultValue: "example.com"
        }
    }, async (args) => {
        return (Object.values(domains).indexOf(args.DOMAIN) > -1);
    });
    createBlock(Scratch.BlockType.BOOLEAN, "checkDpiBlock", Scratch.translate("check dpi [DOMAIN] for block"), {
        DOMAIN: {
            type: Scratch.ArgumentType.STRING,
            defaultValue: "twitter.com"
        }
    }, async (args) => {
        return (Object.values(dpi).indexOf(args.DOMAIN) > -1);
    });

    Scratch.extensions.register(new Extension());
})(Scratch);
